import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category using multiple selector strategies
    const electronicsSelectors = [
      'a:has-text("Electronics")',
      '.category-card:has-text("Electronics")',
      'xpath=//a[contains(text(), "Electronics")]'
    ];

    // Try different selectors until one works
    for (const selector of electronicsSelectors) {
      try {
        await page.waitForSelector(selector, { timeout: 5000 });
        await page.click(selector);
        break;
      } catch (err) {
        continue;
      }
    }

    // Wait for navigation to complete
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract data to verify we're on Electronics category
    const categoryTitle = await page.textContent('h2:has-text("Electronics"), .category-card:has-text("Electronics")').catch(() => null);
    const electronicsProducts = await page.$$eval('.product-card, .category-card', 
      cards => cards.filter(card => card.textContent.includes('Electronics')).length
    ).catch(() => 0);

    return {
      success: true,
      action: "Navigated to Electronics category",
      extractedData: {
        categoryTitle: categoryTitle || 'Electronics',
        electronicsProductsCount: electronicsProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
